				   addi $s0, $s0, 6
				   addi $s2, $s2, -1
		
		gerarPersonagem_L: beq $s0, $zero, gerarPersonagem_C
				   
				   beq $fp,  1, STATE_1
				   beq $fp, -1, STATE_2
				   
				   STATE_1: lw $4, 65536($t1)
				   	    j pintar
				   STATE_2: lw $4, 65920($t1)
				   	
				   pintar:
					   sw   $4, 0($t2)
					   addi $t1, $t1, 4
					   addi $t2, $t2, 4
					   addi $s0, $s0, -1
				   
					   j gerarPersonagem_L

	MOVE:
	       	lui  $k0, 0xffff # endereco reservado para entrada do teclado
	        addi $s5, $zero, 'a'
	        addi $s6, $zero, 'd'
       
		INPUT:
			lw  $t9, 0($k0) # t9: tecla pressionada? (0/1)
	       		beq $t9, $zero, no_keypress
       		
       			lw  $t7, 4($k0) # t7: tecla pressionada ASCII
      			beq $t7, $s5, key_A
       			beq $t7, $s6, key_D
       		
       			j no_keypress # tecla invlida
	
		 key_A: # ESQUERDA
		 	jal gerarCenario
		 	addi $s1, $s1, -12 # -12 bytes de deslocamento
		 	j switchSTATE
		 	
		 key_D: # DIREITA
		 	jal gerarCenario
		 	addi $s1, $s1, 12 # +12 bytes de deslocamento
		 	j switchSTATE
		 	
		 switchSTATE:
		 	beq $fp, -1, changeSTATE_to_1
		 	beq $fp,  1, changeSTATE_to_2
		 	
		 	changeSTATE_to_1: addi $fp, $zero,  1
		 			  j jal_Personagem
		 			  
		 	changeSTATE_to_2: addi $fp, $zero, -1
		 	
		 	jal_Personagem: jal Personagem
	 	
		 	j no_keypress
	
		no_keypress: j INPUT
